INSERT INTO `hennessy_sauvignon_questions` (`id`, `question`, `answer_correct`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Ngày Quốc tế Sauvignon Blanc năm nay rơi vào ngày nào?', 'Chính thức là ngày thứ sáu đầu tiên của tháng Năm, nhằm ngày 7 tháng Năm năm 2021!', 1, '2021-04-27 14:06:48', '2021-04-27 14:25:08'),
(2, 'Nhiều thế kỷ trước, ở một vườn nho đầy nắng tại Pháp, Sauvignon Blanc đã gặp gỡ Cabernet Franc. Hai giống nho hợp thành một bằng cách nào đó, tạo nên một giống nho mới:', 'Cabernet Sauvignon – Vua của các giống nho đỏ!', 1, '2021-04-27 14:27:05', '2021-04-27 14:27:05'),
(3, 'New Zealand là quốc gia sản xuất những dòng vang Sauvignon Blanc ngon nhất thế giới (bên cạnh Pháp & Mỹ), Sauvignon Blanc tại New Zealand được trồng nhiều nhất ở vùng nào?', 'Marlborough. Hầu như mọi chai vang Sauvignon Blanc, khoảng 90%, ở New Zealand đến từ vùng này.', 1, '2021-04-27 14:28:07', '2021-04-28 14:08:33'),
(4, 'Cloudy Bay Sauvignon Blanc từ đất nước New Zealand đã nhận được hơn 50 bình phẩm bởi nhiều chuyên gia rượu vang trên thế giới, với điểm trung bình 92.3  trong 10 năm qua. Anh/chị đã thử', '', 1, '2021-04-27 14:29:13', '2021-04-28 14:08:44');

